    ]
  }
  render() {
    return (
      <div className="App">
        <Header navigation={this.state.navigation}/>
        <section className = "main-container">

          <div className="inner-box">
              <div className="title">
                {/* <div className="divider"></div> */}
                <h3>HI, <br></br>MY NAME'S</h3>
                <span className="name"><span className="even-bigger">C</span>eci<span className="bigger">l</span>ia  <span className="even-bigger">T</span>r<span className="bigger">a</span><span className="even-bigger">n</span></span>
